package leetcode.FindtheDifference;

import java.util.HashMap;
import java.util.Map;

/**
 * Created by daisyli on 2017/4/8.
 */
public class Solution {
    public static char findTheDifference(String s, String t) {
        char tmp = 0x00;
        for(int i=0;i<s.length();i++)
            tmp =(char)( tmp ^ s.charAt(i));
        for(int i=0;i<t.length();i++)
            tmp = (char)(tmp ^ t.charAt(i));
        return tmp;


    }

    public static void main(String[] args) {
        String s = "";

        String t = "";
        System.out.println(Solution.findTheDifference(s, t));
        System.out.println(Solution.findTheDifference("acbd", "abcdd"));
    }
}
